import { library } from "@fortawesome/fontawesome-svg-core";

import {
  faCalendarDay,
  faPaintRoller,
  faTachometerAltFast,
  faStore,
  faCameraMovie,
  faInfoCircle
} from "@fortawesome/pro-duotone-svg-icons";

library.add(
  faCalendarDay,
  faPaintRoller,
  faTachometerAltFast,
  faStore,
  faCameraMovie,
  faInfoCircle
);

export default library;
